import React, { useEffect, useState } from 'react'

const Daily = () => {
    const [daily , setDaily] = useState([]);
    useEffect(()=>{
        fetch("http://localhost:3004/dailly")
        .then(response => response.json())
        .then(data => {
          // Handle the response data
          console.log(data);
          setDaily(data)
        })

    },[])
  return (
    <div>Daily
        {daily.map(obj => {
            return obj.title
        })}
    </div>
  )
}

export default Daily
